(window.webpackJsonp=window.webpackJsonp||[]).push([[32],{"./src/Progress/README.md":function(n,o,s){"use strict";s.r(o),o.default='# Countdown\n\n## 使用\n\n在页面 `json` 中引入组件：\n\n```json\n// import in `page.json`:\n"usingComponents": {\n  "oak-countdown": "path/to/your/oakui/Progress/progress"\n}\n```\n\n在页面使用\n```html\n\x3c!-- use in `page.wxml` --\x3e\n<oak-progress />\n```\n\n## 代码演示\n### 基础用法\n```html\n  <oak-progress bgColor="{{ \'#FCFCFC\' }}" activeColor="{{ \'#DDDDDD\' }}" bordeRadiu="{{ 12 }}" strokeWidth="{{ 50 }}"></oak-progress>\n```\n\n## API\nAPI说明。\n\n| 属性 | 说明 | 类型 | 默认值 |\n|-----------|-----------|-----------|-------------|\n| bgColor | 背景色 | `String` | `` |\n| activeColor | 选择的颜色 | `String` | `` |\n| bordeRadiu | 进度条设置按钮 | `Number` | `0` |\n| strokeWidth | 进度条百分比 | `Number` | `0` |\n\n## 外部样式类\n\n| 类名 | 说明 |\n|-----------|-----------|\n| ext-class | 设置根元素的样式 |\n| active-class | 设置选择的进度条样式 |\n| disabled-class | 设置置灰样式 |\n\n\n'}}]);